import { ComponentType } from "react";

import LiveVideo from "../Containers/LiveVideo";
import Contact from "../Containers/Contact";
import Home from "../Containers/Home";
import Menu from "../Containers/Menu";
import OpeningHours from "../Containers/OpeningHours";

interface route {
    path: string;
    name: string;
    component: ComponentType;
}

const routes: route[] = [
    {
        path: '/',
        name: 'Home',
        component: Home
    },
    {
        path: '/menu',
        name: 'Menu',
        component: Menu
    },
    {
        path: '/openingstijden',
        name: 'Openingstijden',
        component: OpeningHours
    },
    {
        path: '/livevideo',
        name: 'Live video',
        component: LiveVideo
    },
    {
        path: '/contact',
        name: 'Contact',
        component: Contact
    }
];

export default routes;
